import { skills } from "../../data";

export default function Skills() {
  return (
    <div>
      <section id="skills">
        <h1>Skills & Certifications</h1>
        <p style={{ paddingTop: "25px" }}>Include all my skills, courses I've taken, certifications, and college degree (in-progress associate degree)</p>

        {skills.map((skill) => (
          <div key={skill.skill}>
            <span>
              {skill.skill}
            </span>

            <span>
              {
                skill.moreInfo == null ? <br/> :
                <p>{skill.moreInfo}</p>
              }
            </span>
            <span>
              {
                skill.url == null ? "" :
                skill.urlOpensInNewTab == true ?
                  <a className="link" href={skill.url} target="_blank" rel="noopener noreferrer">{skill.urlName}</a>
                  :
                  <a className="link" href={skill.url}>{skill.urlName}</a>
                }
            </span>
          </div>
        ))}
      </section>
    </div>
  );
}
